import React from 'react';


class ClassComponent extends React.Component {
    constructor() {
        super();
        this.state = {
            course: "React Native",
        }
    }

    render() {
        return <CourseComponent course={this.state.course} />
    }
}

class CourseComponent extends React.component {
    constructor(props){
        super(props);
    }

    render() {
        return <h1>My favourite course is {this.props.course} !</h1>
    }
}

export default ClassComponent;
